import "./App.css";
import Footer from "./Components/Footer";
import Header from './Components/Header';
import { Container } from 'react-bootstrap';

function App() {
  return (
    <>
      <Header />
      <Container>
        <main>
          <h1>Welcome To ProShop</h1>
        </main>
      </Container>

      <Footer />
    </>
  );
}

export default App;
